import React from 'react';
import './App.css';
import GenerateCustomersForm from './GenerateCustomersForm';

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <h1>Customer Generator</h1>
            </header>
            <GenerateCustomersForm />
        </div>
    );
}

export default App;
